import React, { useEffect } from "react";
import './App.css';
import axios from "axios";

function App() {

  const baseUrl = "http://localhost:8080"

  useEffect(() => {
    getTodos();
  }, [])

  async function getTodos() {
    await axios
      .get(baseUrl + "/todo")
      .then((Response) => {
        console.log(Response.data)
      })
      .catch((error) => {
        console.error(error)
      })

  }

  return (
    <div className="App">
      hello
    </div>
  );
}

export default App;
